  let todos = [
    { sn: 0,
      name:"Ayush",
      desc:"074bct501"
    },
    {
      sn :1,
      name:"Abiral",
      desc:"074bct502"
    },
    {
      sn:3,
      name:"Aman",
      desc:"074bct503"
    }
  ]
  return (
    <>
    <Header title="Hello" searchbar={false} />
    <Todos todos={todos}/>
    <Footer/>
    </>
  );
}

export default App;
